import "./App.css";
import react, { useState } from "react";

const api = {
  base_url: "https://api.openweather.org/data/2.5/",
  api_key: "04e60fd3480011e71d9bebe70e77ab12",
};

function App() {
  const [search, setSearch] = useState("");

  const searchPressed = () => {
    fetch(`${api.base_url}forecast?lat=44.34&lon=10.99&appid=${api.api_key}`)
      .then((res) => res.json())
      .then((result) => {
        console.log(result);
      });
  };

  return (
    <div className="App">
      <h1>Wheather forecast</h1>

      <div>
        <input
          type="text"
          placeholder="search city/state.."
          onChange={(e) => setSearch(e.target.value)}
        />
        <button onClick={searchPressed}>Search</button>
      </div>

      {/* {city} */}
      <p>Pune</p>

      {/* {tempreture} */}
      <p>32 F,humidity</p>
    </div>
  );
}

export default App;
